import React from "react";
import styled from "styled-components";
import { Breadcrumbs } from "../components/pageSpecific/brochure/PageTitle";
import { Container } from "../components/layout/Container";

const PatioDoorTemplate = ({ children, title, parent }) => {
  const links = [
    {
      name: "Design Options",
      href: "/sub/designoptions",
    },
    {
      name: "Energy Efficiency",
      href: "/sub/energyefficiency",
    },
    {
      name: "Find a Dealer",
      href: "/sub/dealerfinder",
    },
  ];

  console.log("test");

  return (
    <Container>
      <Breadcrumbs links={links} title={title} parent="Patio Doors" />
      {children}
    </Container>
  );
};

export default PatioDoorTemplate;
